="float: left; margin: 0.5em 0.9em 0.4em 0em;"><div class="thumbinner mp-thumb" style="background: transparent; border: none; padding: 0; max-width: 134px;"><a href="/wiki/File:Arms_of_Clifford.svg" class="image" title="Clifford&#39;s coat of arms"><img alt="Clifford&#39;s coat of arms" src="//upload.wikimedia.org/wikipedia/commons/thumb/0/0b/Arms_of_Clifford.svg/134px-Arms_of_Clifford.svg.png" decoding="async" width="134" height="147" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/0/0b/Arms_of_Clifford.svg/201px-Arms_of_Clifford.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/0/0b/Arms_of_Clifford.svg/268px-Arms_of_Clifford.svg.png 2x" data-file-width="512" data-file-height="563" /></a><div class="thumbcaption" style="padding: 0.25em 0; word-wrap: break-word;">Clifford's coat of arms</div></div></div><p><b><a href="/wiki/Henry_Clifford,_10th_Baron_Clifford" title="Henry Clifford, 10th Baron Clifford">Henry Clifford, 10th Baron Clifford</a></b> (<abbr title="circa">c.</abbr><span style="white-space:nowrap;">&#8201;1454</span>&#160;– 23&#160;April&#160;1523), was an <a href="/wiki/Peerage_of_England" title="Peerage of England">English nobleman</a>. Henry's father died fighting for the <a href="/wiki/House_of_Lancaster" title="House of Lancaster">House of Lancaster</a>, and when <a href="/wiki/Henry_VII_of_England" title="Henry VII of England">Henry Tudor</a> came to the throne in 1485, he relied on Clifford as a loyal Tudor servant to control the north of England. Clifford was not always successful in this, and his actions were not always popular, but his royal service was extremely profitable. He frequently quarrelled with his neighbours, occasionally resulting in violent feuds. He married a cousin of the King and his infidelity became notorious. Clifford's relations with <a href="/wiki/Henry_Clifford,_1st_Earl_of_Cumberland" title="Henry Clifford, 1st Earl of Cumberland">his eldest son and heir</a> were also turbulent; he complained that his son lived above his station, consorted with men of bad influence and was excessively violent. Clifford outlived the King and attended the coronation of <a href="/wiki/Henry_VIII" title="Henry VIII">Henry&#160;VIII</a> in 1509. Continuing to serve as the King's man in the north, he took part in the decisive English victory over the Scots <a href="/wiki/Battle_of_Flodden" title="Battle of Flodden">at Flodden</a> in 1513.(<b><a href="/wiki/Henry_Clifford,_10th_Baron_Clifford" title="Henry Clifford, 10th Baron Clifford">Full&#160;article...</a></b>)</p><div class="tfa-recent" style="text-align: right;">Recently featured: <div class="hlist hlist-separated inline"><ul><li><a href="/wiki/Loveless_(album)" title="Loveless (album)"><i>Loveless</i> (album)</a></li><li><a href="/wiki/William_Henry_Harrison_1840_presidential_campaign" title="William Henry Harrison 1840 presidential campaign">William Henry Harrison 1840 presidential campaign</a></li><li><a href="/wiki/Dali_(goddess)" title="Dali (goddess)">Dali (goddess)</a></li></ul></div></div><div class="tfa-footer hlist hlist-separated noprint" style="text-align: right;"><ul><li><b><a href="/wiki/Wikipedia:Today%27s_featured_article/November_2020" title="Wikipedia:Today&#39;s featured article/November 2020">Archive</a></b></li><li><b><a href="https://lists.wikimedia.org/mailman/listinfo/daily-article-l" class="extiw" title="mail:daily-article-l">By email</a></b></li><li><b><a href="/wiki/Wikipedia:Featured_articles" title="Wikipedia:Featured articles">More featured articles</a></b></li></ul></div></div><h2 id="mp-dyk-h2" class="mp-h2"><span class="mw-headline" id="Did_you_know_...">Did you know&#160;...</span></h2><div id="mp-dyk"><div class="dyk-img" style="float: right; margin-left: 0.5em;"><div class="thumbinner mp-thumb" style="background: transparent; border: none; padding: 0; max-width: 162px;"><a href="/wiki/File:Grave_of_Shah_Jalal.jpg" class="image" title="Shah Jalal&#39;s open-roofed grave"><img alt="Shah Jalal&#39;s open-roofed grave" src="//upload.wikimedia.org/wikipedia/commons/thumb/b/ba/Grave_of_Shah_Jalal.jpg/162px-Grave_of_Shah_Jalal.jpg" decoding="async" width="162" height="122" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/b/ba/Grave_of_Shah_Jalal.jpg/243px-Grave_of_Shah_Jalal.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/b/ba/Grave_of_Shah_Jalal.jpg/324px-Grave_of_Shah_Jalal.jpg 2x" data-file-width="1024" data-file-height="768" /></a><div class="thumbcaption" style="padding: 0.25em 0; word-wrap: break-word;"><a href="/wiki/Shah_Jalal" title="Shah Jalal">Shah Jalal</a>'s open-roofed grave</div></div></div><ul><li>... that according to local legend, the catfish that inhabit the reservoir at the <b><a href="/wiki/Shah_Jalal_Dargah" title="Shah Jalal Dargah">Shah Jalal Dargah</a></b> <i>(grave pictured)</i> are the cursed and reincarnated soldiers of <a href="/wiki/Gour_Govinda" title="Gour Govinda">Gour Govinda</a>?</li><li>... that as a <a href="/wiki/Lobbying_in_the_United_States" title="Lobbying in the United States">lobbyist</a> for <a href="/wiki/Bacardi" title="Bacardi">Bacardi</a>, <b><a href="/wiki/Otto_Reich" title="Otto Reich">Otto Reich</a></b>, a former <a href="/wiki/List_of_ambassadors_of_the_United_States_to_Venezuela" title="List of ambassadors of the United States to Venezuela">U.S. ambassador to Venezuela</a>, played a role in passing legislation that stripped trademark protection from <a href="/wiki/Havana_Club" title="Havana Club">Havana Club</a> rum?</li><li>... that the 2013 Nepali historical drama <i><b><a href="/wiki/Badhshala" title="Badhshala">Badhshala</a></b></i> was briefly banned by the <a href="/wiki/Nepali_Army" title="Nepali Army">Nepali Army</a> because the actors wore military uniforms without permission?</li><li>... that with the designation of County Highway <b><a href="/wiki/A-2_(Michigan_county_highway)" title="A-2 (Michigan county highway)"><span class="nowrap">A-2</span></a></b> in 1970, Mrs.&#160;Howard "Gene" Temple became the first Michigan woman to acquire a highway designation from the State Highway Commission?</li><li>... that the opera <i><b><a href="/wiki/Die_Prinzessin_Girnara" title="Die Prinzessin Girnara">Die Prinzessin Girnara</a></b></i>, by composer <a href="/wiki/Egon_Wellesz" title="Egon Wellesz">Wellesz</a> and librettist <a href="/wiki/Jakob_Wassermann" title="Jakob Wassermann">Wassermann</a>, and based on a legend from India, premiered simultaneously at two opera houses in 1921?</li><li>... that Estonian linguist <b><a href="/wiki/Jaan_Puhvel" title="Jaan Puhvel">Jaan Puhvel</a></b> has worked for more than half a century on his multi-volume <i>Hittite Etymological Dictionary</i><span style="padding-left:0.15em;">&#63;</span></li><li>... that in <b><a href="/wiki/Illinois_Public_Access_Opinion_16-006" title="Illinois Public Access Opinion 16-006">Public Access Opinion 16-006</a></b>, the <a href="/wiki/Illinois_Attorney_General" title="Illinois Attorney General">Illinois Attorney General</a> ordered Chicago police officers to release their private emails about the police-involved <a href="/wiki/Murder_of_Laquan_McDonald" title="Murder of Laquan McDonald">murder of Laquan McDonald</a>?</li><li>... that at age&#160;102, <b><a href="/wiki/Beatrice_Lumpkin" title="Beatrice Lumpkin">Beatrice Lumpkin</a></b>, a union organizer and lifelong member of <a href="/wiki/Communist_Party_USA" title="Communist Party USA">the Communist Party</a>, donned <a href="/wiki/Hazmat_suit" title="Hazmat suit">hazmat suit</a>–style gear to drop off her vote-by-mail ballot for <a href="/wiki/2020_United_States_elections" title="2020 United States elections">the US elections</a>?</li></ul><div class="dyk-footer hlist hlist-separated noprint" style="margin-top: 0.5em; text-align: right;"><ul><li><b><a href="/wiki/Wikipedia:Recent_additions" title="Wikipedia:Recent additions">Archive</a></b></li><li><b><a href="/wiki/Help:Your_first_article" title="Help:Your first article">Start a 