upload.wikimedia.org/wikipedia/commons/thumb/4/46/Goni_making_landfall_on_the_Philippines_on_October_31.gif/311px-Goni_making_landfall_on_the_Philippines_on_October_31.gif 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/4/46/Goni_making_landfall_on_the_Philippines_on_October_31.gif/414px-Goni_making_landfall_on_the_Philippines_on_October_31.gif 2x" data-file-width="1329" data-file-height="609" /></a><div class="thumbcaption" style="padding: 0.25em 0; word-wrap: break-word; text-align: left;">Typhoon Goni</div></div></div><ul><li><b><a href="/wiki/2020_Kabul_University_attack" title="2020 Kabul University attack">A shooting</a></b> at <a href="/wiki/Kabul_University" title="Kabul University">Kabul University</a>'s campus, Afghanistan, leaves 35 people dead and 50 others injured.</li><li><b><a href="/wiki/Typhoon_Goni_(2020)" title="Typhoon Goni (2020)">Typhoon Goni</a></b> <i>(satellite image shown)</i> makes landfall in the Philippines as a <a href="/wiki/Tropical_cyclone_scales#Western_Pacific" title="Tropical cyclone scales">super typhoon</a>, killing at least 24 people.</li><li>Scottish actor <b><a href="/wiki/Sean_Connery" title="Sean Connery">Sean Connery</a></b> dies at the age of 90.</li><li><b><a href="/wiki/2020_Aegean_Sea_earthquake" title="2020 Aegean Sea earthquake">An earthquake</a></b> in the <a href="/wiki/Aegean_Sea" title="Aegean Sea">Aegean Sea</a> kills at least 110 people and injures more than 1,000 others.</li></ul><div class="itn-footer" style="margin-top: 0.5em;"><div><b><a href="/wiki/Portal:Current_events" title="Portal:Current events">Ongoing</a></b>: <div class="hlist hlist-separated inline"><ul><li><a href="/wiki/2020_Nagorno-Karabakh_war" title="2020 Nagorno-Karabakh war">Nagorno-Karabakh war</a></li><li><a href="/wiki/October_2020_Polish_protests" title="October 2020 Polish protests">Polish protests</a></li><li><a href="/wiki/2020_Thai_protests" title="2020 Thai protests">Thai protests</a></li><li><a href="/wiki/2020_United_States_presidential_election" title="2020 United States presidential election">US presidential election</a></li></ul></div></div><div><b><a href="/wiki/Deaths_in_2020" title="Deaths in 2020">Recent deaths</a></b>&#58; <div class="hlist hlist-separated inline"><ul><li><a href="/wiki/Faustas_Lat%C4%97nas" title="Faustas Latėnas">Faustas Latėnas</a></li><li><span class="nowrap"><a href="/wiki/H._G._Somashekar_Rao" title="H. G. Somashekar Rao">H. G. Somashekar Rao</a></span></li><li><a href="/wiki/Don_Talbot" title="Don Talbot">Don Talbot</a></li><li><span class="nowrap"><a href="/wiki/T._N._Krishnan" title="T. N. Krishnan">T. N. Krishnan</a></span></li><li><a href="/wiki/Robert_Fisk" title="Robert Fisk">Robert Fisk</a></li><li><a href="/wiki/Betty_Dodson" title="Betty Dodson">Betty Dodson</a></li></ul></div></div></div><div class="itn-footer hlist hlist-separated noprint" style="text-align: right;"><ul><li><b><a href="/wiki/Wikipedia:In_the_news/Candidates" title="Wikipedia:In the news/Candidates">Nominate an article</a></b></li></ul></div></div><h2 id="mp-otd-h2" class="mp-h2"><span class="mw-headline" id="On_this_day">On this day</span></h2><div id="mp-otd"><p><b><a href="/wiki/November_5" title="November 5">November 5</a></b>: <b><a href="/wiki/Guy_Fawkes_Night" title="Guy Fawkes Night">Guy Fawkes Night</a></b> in <a href="/wiki/Great_Britain" title="Great Britain">Great Britain</a> and certain <a href="/wiki/Commonwealth_of_Nations" title="Commonwealth of Nations">Commonwealth</a> countries (<a href="/wiki/1605" title="1605">1605</a>)</p><div style="float:right;margin-left:0.5em;" id="mp-otd-img"><div class="thumbinner mp-thumb" style="background: transparent; border: none; padding: 0; max-width: 117px;"><a href="/wiki/File:Sidney_Reilly_German_Passport_September_1918.jpg" class="image" title="Sidney Reilly"><img alt="Sidney Reilly" src="//upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Sidney_Reilly_German_Passport_September_1918.jpg/117px-Sidney_Reilly_German_Passport_September_1918.jpg" decoding="async" width="117" height="167" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Sidney_Reilly_German_Passport_September_1918.jpg/176px-Sidney_Reilly_German_Passport_September_1918.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Sidney_Reilly_German_Passport_September_1918.jpg/234px-Sidney_Reilly_German_Passport_September_1918.jpg 2x" data-file-width="400" data-file-height="570" /></a><div class="thumbcaption" style="padding: 0.25em 0; word-wrap: break-word;">Sidney Reilly</div></div></div><ul><li><a href="/wiki/1556" title="1556">1556</a> – At the <b><a href="/wiki/Second_Battle_of_Panipat" title="Second Battle of Panipat">Second Battle of Panipat</a></b>, forces of the <a href="/wiki/Mughal_Empire" title="Mughal Empire">Mughal</a> emperor <a href="/wiki/Akbar" title="Akbar">Akbar</a> captured <a href="/wiki/Hemu" title="Hemu">Hemu</a>, the Hindu emperor of north India.</li><li><a href="/wiki/1757" title="1757">1757</a> – <a href="/wiki/Seven_Years%27_War" title="Seven Years&#39; War">Seven Years' War</a>: <a href="/wiki/Kingdom_of_Prussia" title="Kingdom of Prussia">Prussian</a> forces led by <a href="/wiki/Frederick_the_Great" title="Frederick the Great">Frederick the Great</a> defeated the allied <a href="/wiki/Kingdom_of_France" title="Kingdom of France">French</a> and <a href="/wiki/Habsburg_Monarchy" title="Habsburg Monarchy">Habsburg</a> armies at the <b><a href="/wiki/Battle_of_Rossbach" title="Battle of Rossbach">Battle of Rossbach</a></b>.</li><li><a href="/wiki/1925" title="1925">1925</a> – <b><a href="/wiki/Sidney_Reilly" title="Sidney Reilly">Sidney Reilly</a></b> <i>(pictured)</i>, known as the "Ace of Spies" and an <a href="/wiki/Inspirations_for_James_Bond" title="Inspirations for James Bond">inspiration for James Bond</a>, was executed by the <a href="/wiki/State_Political_Directorate" title="State Political Directorate">Soviet secret police</a>.</li><li><a href="/wiki/1950" title="1950">1950</a> – <a href="/wiki/Korean_War" title="Korean War">Korean War</a>: The <a href="/wiki/27th_Infantry_Brigade_(United_Kingdom)" title="27th Infantry Brigade (United Kingdom)">27th British Commonwealth Brigade</a> succeeded in preventing a Chinese breakthrough at the <b><a href="/wiki/Battle_of_Pakchon" title="Battle of Pakchon">Battle of Pakchon</a></b>.</li><li><a href="/wiki/1995" title="1995">1995</a> – <b><a href="/wiki/Andr%C3%A9_Dallaire" title="André Dallaire">André Dallaire</a></b> was thwarted in his attempt to assassinate Canadian prime minister <a href="/wiki/Jean_Chr%C3%A9tien" title="Jean Chrétien">Jean Chrétien</a> at <a href="/wiki/24_Sussex_Drive" title="24 Sussex Drive">24&#160;Sussex Drive</a> in Ottawa when Chrétien's wife locked the door.</li></ul><div class="hlist hlist-separated" style="margin-top: 0.5em;"><ul><li><b><a href="/wiki/Edwin_Flack" title="Edwin Flack">Edwin Flack</a></b>  (<abbr title="born">b.</abbr>&#160;1873)</li><li><b><a href="/wiki/Vivien_Leigh" title="Vivien Leigh">Vivien Leigh</a></b>  (<abbr title="born">b.</abbr>&#160;1913)</li><li><b><a href="/wiki/Mary_W._Bacheler" title="Mary W. Bacheler">Mary W. Bacheler</a></b>  (<abbr title="died">d.</abbr>&#160;1939)</li></ul></div><div style="margin-top: 0.5em;">More anniversaries: <div class="hlist hlist-separated inline nowraplinks"><ul><li><a href="/wiki/November_4" title="November 4">November 4</a></li><li><b><a href="/wiki/November_5" title="November 5">November 5</a></b></li><li><a href="/wiki/November_6" title="November 6">November 6</a></li></ul></div></div><div class="otd-footer hlist hlist-separated noprint" style="text-align: right;"><ul><li><b><a href="/wiki/Wikipedia:Selected_anniversaries/November" title="Wikipedia:Selected anniversaries/November">Archive</a></b></li><li><b><a href="https://lists.wikimedia.org/mailman/listinfo/daily-article-l" class="extiw" title="mail:daily-article-l">By email</a></b></li><li><b><a href="/wiki/List_of_days_of_the_year" title="List of days of the year">List of days of the year</a></b></li></ul></div></div></td></tr></tbody></table><div id="mp-lower" class="MainPageBG mp-bordered"><div id="mp-bottom"><h2 id="mp-tfp-h2" class="mp-h2"><span id="Today.27s_featured_picture"></span><span class="mw-headline" id="Today's_featured_picture">Today's featured picture</span></h2><div id="mp-tfp"><table role="presentation" style="margin:0 3px 3px; width:100%; box-sizing:border-box; text-align:left; background-color:transparent; border-collapse:collapse;"><tbody><tr><td style="padding:0 0.9em 0 0; width:300px;"><a href="/wiki/File:Ida_M._Tarbell_crop.jpg" class="image" title="Ida Tarbell"><img alt="Ida Tarbell" src="//upload.wikimedia.org/wikipedia/commons/thumb/6/68/Ida_M._Tarbell_crop.jpg/300px-Ida_M._Tarbell_crop.jpg" decoding="async" width="300" height="357" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/6/68/Ida_M._Tarbell_crop.jpg/450px-Ida_M._Tarbell_crop.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/6/68/Ida_M._Tarbell_crop.jpg/600px-Ida_M._Tarbell_crop.jpg 2x" data-file-width="1988" data-file-height="2364" /></a></td><td style="padding:0 6px 0 0"><p><b><a href="/wiki/Ida_Tarbell" title="Ida Tarbell">Ida Tarbell</a></b> (November&#160;5, 1857&#160;– January&#160;6, 1944) was an American writer, journalist, biographer and lecturer. One of the leading <a href="/wiki/Muckraker" title="Muckraker">muckrakers</a> of the <a href="/wiki/Progressive_Era" title="Progressive Era">Progressive Era</a> of the late 19th and early 20th centuries, she pioneered <a href="/wiki/Investigative_journalism" title="Investigative journalism">investigative journalism</a>. Her best-known exposé was of the <a href="/wiki/Standard_Oil" title="Standard Oil">Standard Oil Company</a>, run at the time by oil tycoon <a href="/wiki/John_D._Rockefeller" title="John D. Rockefeller">John D. Rockefeller</a>. This inspired other journalists to investigate and write about <a href="/wiki/Trust_(business)" title="Trust (business)">trusts</a>, large businesses that (in the absence of strong antitrust laws in the 19th century) attempted to gain <a href="/wiki/Monopoly" title="Monopoly">monopolies</a> in various industries. She also wrote biographies of businessmen <a href="/wiki/Elbert_Henry_Gary" title="Elbert Henry Gary">Elbert Henry Gary</a>, chairman of <a href="/wiki/U.S._Steel" title="U.S. Steel">U.S. Steel</a>, and <a href="/wiki/Owen_D._Young" title="Owen D. Young">Owen D. Young</a>, president of <a href="/wiki/General_Electric" title="General Electric">General Electric</a>.</p><p style="text-align:left;"><small>Photograph credit: <a href="/wiki/James_E._Purdy" title="James E. Purdy">James E. Purdy</a>; restored by <a href="/wiki/User:Adam_Cuerden" title="User:Adam Cuerden">Adam Cuerden</a></small></p><div class="potd-recent" style="text-align:right;">Recently featured: <div class="hlist hlist-separated inline"><ul><li><a href="/wiki/Template:POTD/2020-11-04" title="Template:POTD/2020-11-04"><i>Le comte Ory</i></a></li><li><a href="/wiki/Template:POTD/2020-11-03" title="Template:POTD/2020-11-03">1966 flood of the Arno</a></li><li><a href="/wiki/Template:POTD/2020-11-02" title="Template:POTD/2020-11-02"><i>Cassini–Huygens</i></a></li></ul></div></div><div class="potd-footer hlist hlist-separated noprint" style="text-align:right;"><ul><li><b><a href="/wiki/Wikipedia:Picture_of_the_day/Archive" title="Wikipedia:Picture of the day/Archive">Archive</a></b></li><li><b><a href="/wiki/Wikipedia:Featured_pictures" title="Wikipedia:Featured pictures">More featured pictures</a></b></li></ul></div></td></tr></tbody></table></div></div></div><div id="mp-other-lower" class="mp-bordered"><h2 id="mp-other" class="mp-h2"><span class="mw-headline" id="Other_areas_of_Wikipedia">Other areas of Wikipedia</span></h2><div id="mp-other-content"><ul><li><b><a href="/wiki/Wikipedia:Community_portal" title="Wikipedia:Community portal">Community portal</a></b> – Bulletin board, projects, resources and activities covering a wide range of Wikipedia areas.</li><li><b><a href="/wiki/Wikipedia:Help_desk" title="Wikipedia:Help desk">Help desk</a></b> – Ask questions about using Wikipedia.</li><li><b><a href="/wiki/Wikipedia:Local_Embassy" title="Wikipedia:Local Embassy">Local embassy</a></b> – For Wikipedia-related communication in languages other than English.</li><li><b><a href="/wiki/Wikipedia:Reference_desk" title="Wikipedia:Reference desk">Reference desk</a></b> – Serving as virtual librarians, Wikipedia volunteers tackle your questions on a wide range of subjects.</li><li><b><a href="/wiki/Wikipedia:News" title="Wikipedia:News">Site news</a></b> – Announcements, updates, articles and press releases on Wikipedia and the Wikimedia Foundation.</li><li><b><a href="/wiki/Wikipedia:Village_pump" title="Wikipedia:Village pump">Village pump</a></b> – For discussions about Wikipedia itself, including areas for technical issues and policies.</li></ul></div><h2 id="mp-sister" class="mp-h2"><span id="Wikipedia.27s_sister_projects"></span><span class="mw-headline" id="Wikipedia's_sister_projects">Wikipedia's sister projects</span></h2><div id="mp-sister-content"><style data-mw-deduplicate="TemplateStyles:r961577119">.mw-parser-output #sister-projects-list{text-align:left;background:transparent;margin:1px;display:flex;flex-wrap:wrap}.mw-parser-output #sister-projects-list>div{width:33%;min-width:20em;white-space:nowrap;display:inline-block;flex:1 0 25%}.mw-parser-output #sister-projects-list>div>div{display:inline-block;vertical-align:middle;padding:6px 4px}.mw-parser-output #sister-projects-list>div>div:first-child{min-width:50px;text-align:center}</style><p>Wikipedia is hosted by the <a href="/wiki/Wikimedia_Foundation" title="Wikimedia Foundation">Wikimedia Foundation</a>, a non-profit organization that also hosts a range of other <a href="https://wikimediafoundation.org/our-work/wikimedia-projects/" class="extiw" title="foundationsite:our-work/wikimedia-projects/">projects</a>:<